import React from 'react';
import s from "./content.module.css"

import { Route } from 'react-router-dom';
import Order_Shoop from './order_Shop/order_Shop'
import Oficial_shoop from './oficial_shoop/oficial_shoop'


const CONTENT = () => {
    let Ord_Shoop = [
        { class: s.nav1, path: "Buy_subscription", name: "Заказ" },
        { class: s.nav2, path: "test2", name: "БД" },
        { class: s.nav3, path: "kk", name: "КК" },
        { class: s.nav4, path: "ord", name: "Оформление" },
        { class: s.nav5, path: "kontakt", name: "Контакты" },
        { class: s.nav6, path: "time_work", name: "Время работы" },
        { class: s.nav7, path: "books", name: "Буквы" },
    ]
    return (
        <div className={s.content}>
            {/* <Route path="/Order_shoop" component={Order_Shoop} /> */}
            <Route path="/Order_shoop" render={() => <Order_Shoop Ord_Shoop={Ord_Shoop}/>} />
            <Route path="/Oficial_shoop" component={Oficial_shoop} />
        </div>
    )
}
export default CONTENT;









